                <div className="w-1/4 text-white">
                    <ul className="p-4">
                        <li className="border-b border-gray-300 py-4">Receiver Name 1</li>
                        <li className="border-b border-gray-300 py-4">Chat 2</li>
                        <li className="border-b border-gray-300 py-4">Chat 3</li>
                    </ul>
                </div>
                <div className="flex-1">
                    <div className="bg-slate-900 p-4 border-b  border-gray-300 text-white text-lg">Receiver Name</div>
                </div>
            </div>
        </>
    );
}
